const sourceArray = [
  source_1,source_2,source_3
]

let maxYear = 0
let minYear = 0

const processData = (sourceData)=>{
  let cacheSet = new Set()
  let yearArray = []
  let countryMap = new Map()
  for (let row of sourceData){
    if (!cacheSet.has(row[0])){
      yearArray.push(row[0])
      cacheSet.add(row[0])
    }
  }
  maxYear = Math.max(...yearArray)
  minYear = Math.min(...yearArray)
  let yearRange = (maxYear - minYear +2)/2
  console.log(yearRange)
  for (let row of sourceData){
    if (countryMap.has(row[1])){
      countryMap.get(row[1])[(maxYear-row[0])/2] = row[2]
    }else{
      countryMap.set(row[1],new Array(yearRange))
      countryMap.get(row[1])[(maxYear-row[0])/2] = row[2]
    }
  }
  yearArray.unshift('Country')
  let retData = [yearArray]
  countryMap.forEach((item,key)=>{
    item.unshift(key)
    retData.push(item)
  })
  return retData
}

